var CarAvailabilityValidator = Class.create();
CarAvailabilityValidator.prototype = 
	Object.extendsObject(global.AbstractAjaxProcessor,{

    isCarAvailable: function() {

		var availableCars = new GlideRecord("x_616811_car_renta_car_records");

		availableCars.get(this.getParameter('sysparm_car_id'));
		if(availableCars.u_boolean_1 == 1)
			return true;
    },

    type: 'CarAvailabilityValidator'
});
